import { useEffect, useMemo,useState } from "react";
import { Link,Routes,Route } from "react-router-dom";
function App() {
  const [state,setState]=useState([]);
  const lists=useMemo(()=>{
    let mass=state.filter((elem)=>{
      return elem.volumeInfo.imageLinks!=undefined
    })
    console.log(mass.length);
    return mass.map((elem)=><img src={elem.volumeInfo.imageLinks.thumbnail}/>)
  },[state.length])
  useEffect(() => {
    const key = "AIzaSyBEIqK7j9rLo7FHM4Fdl41EITEsGLHFx9E", book = "Harry Poter";
    fetch(`https://www.googleapis.com/books/v1/volumes?q=${book}&key=${key}&maxResults=30`)
    .then((res) => {
      res.json().then((mess)=>{
        setState(mess.items)
      })
    });
  }, []);
  return (<Routes>
    <Route path="/" element={<div>{lists}
      <Link to="/hello">To hello</Link>
    </div>}/>
    <Route path="/hello" element={<Hello/>}/>
    <Route path="/world" element={<World/>}/>
  </Routes>)
}
const Hello=()=>(<Link to="/world">hello</Link>);
const World=()=>(<Link to="/">world</Link>)
export default App;

